@howardlindzon LOL, guilty of a few of those (though I got stopped out quickly each time). It's so tempting because of the percentages on turn-arounds.  If one caught $ARKK at low of $35, they'd be +20% at 43 in just a week (if they don't follow back down).   
Or... $U was down 86% (from 210 high tick down to low of 29.09). At today's 41.65 $U is still down 80%. That last $12/share round trip was 6% on the way down (from 210), but 40% back up (from 29.09) assuming my math is ok. That big percentage is hardly visible on the 1yr chart. 
Problems: Nobody catches the top/bottom tick, and profits can be given up just as quickly if the overall decline continues. If you don't have a stop, you could quickly have a new extended loss. I personally only try just above a support level or after a reasonably tight base (indicating where to put a tight stop). Not saying anything new here, and not recommending, but just wanted to share because of the number of stocks showing extreme declines.
